import './App.css';

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" element/>
      <Route path="" element/>
      <Route path="" element/>
      <Route path="/" element/>
      {/* <Route path="*" element={<Error404/>}/> */}
    </Routes>
    </BrowserRouter>
  );
}

export default App;
